First launch trin using HTTP as the json-rpc transport protocol: cargo run -- --web3-transport http Then, in a python shell: >>> from web3 import Web3
>>> w3 = Web3(Web3.HTTPProvider("http://127.0.0.1:8545"))
>>> w3.clientVersion
'trin 0.0.1-alpha'
>>> w3.eth.blockNumber
11870768 The client version responds immediately, from the trin client. The block number is retrieved more slowly, by proxying to Infura. To interact with trin at the lowest possible level, try netcat: nc -U /tmp/trin-jsonrpc.ipc
